import React from "react";
import img from  "../images/Group 1541.svg";
import "./Main.css";

const Main = () => {
    return (
        <>
    <div className="header">
        <img src={img} alt="" />
        <h1>Select Dishes</h1>
    </div>

    <div className="bg-black h-16"></div>
    </>
    )
}
export default Main;
